import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Calendar from 'react-calendar';
import 'react-calendar/dist/Calendar.css';
import '../styles/therapistDashboard.css';

const TherapistDashboard = () => {
  const navigate = useNavigate();
  const [selectedDate, setSelectedDate] = useState(new Date());

  const handleDateChange = (date) => {
    setSelectedDate(date);
  };

  const handleNavigation = (path) => {
    navigate(path);
  };

  return (
    <div className="therapist-dashboard-container">
      <header className="therapist-dashboard-header">
        <h1>Dashboard Terapeuta</h1>
      </header>
      <div className="therapist-dashboard-content">
        <div className="button-grid">
          <button className="dashboard-button" onClick={() => handleNavigation('/therapist/patients')}>
            <i className="fa fa-users" aria-hidden="true"></i>
            <span>Lista de Pacientes</span>
          </button>
          <button className="dashboard-button" onClick={() => handleNavigation('/therapist/routines')}>
            <i className="fa fa-clock-o" aria-hidden="true"></i>
            <span>Rutinas y Tiempo</span>
          </button>
          <button className="dashboard-button" onClick={() => handleNavigation('/therapist/interests')}>
            <i className="fa fa-star" aria-hidden="true"></i>
            <span>Intereses</span>
          </button>
          <button className="dashboard-button" onClick={() => handleNavigation('/therapist/satisfaction')}>
            <i className="fa fa-smile-o" aria-hidden="true"></i>
            <span>Satisfacción</span>
          </button>
          <button className="dashboard-button" onClick={() => handleNavigation('/messaging')}>
            <i className="fa fa-comments" aria-hidden="true"></i>
            <span>Mensajería</span>
          </button>
          <button className="dashboard-button" onClick={() => handleNavigation('/therapist/invite')}>
            <i className="fa fa-envelope" aria-hidden="true"></i>
            <span>Generar Invitación</span>
          </button>
        </div>
        <div className="calendar-container">
          <Calendar onChange={handleDateChange} value={selectedDate} />
        </div>
      </div>
      <footer className="therapist-dashboard-footer">
        <p>2025 © Tu Plataforma</p>
      </footer>
    </div>
  );
};

export default TherapistDashboard;
